#include <fstream>

using namespace std;

int main() {
  ifstream f("maxd.in");
  ofstream g("maxd.out");
  int a, b, dmax = 0, min = 0, nrmin = 0;
  f >> a >> b;
  for (int i = a; i <= b; ++i) {
    int d = 0;
    for (int j = 1; j * j <= i; ++j) {
      if (i % j == 0) {
        ++d;
        if (i / j != j) ++d;
      }
    }
    if (d > dmax) {
      dmax = d;
      min = i;
      nrmin = 1;
    } else if (d == dmax) {
      nrmin = nrmin + 1;
    }
  }
  g << min << " " << dmax << " " << nrmin << endl;
  f.close();
  g.close();
  return 0;
}
